import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
function App() {
  return (
    <div>
      <BrowserRouter>
         <Navbar/>
         <Routes>
            <Route></Route>
         </Routes>
      </BrowserRouter> 
    </div>
  );
}

export default App;
